Pasos que se siguen en la implementaci\xc3\xb3n:
\begin{itemize}
\item Se parte de unos requerimientos
\item Se evaluan alternativas para cumplirlos
\item Abstracci\xc3\xb3n del proceso de soluci\xc3\xb3n usando alg\xc3\xban m\xc3\xa9todo
\item Se escogen un lenguaje y herramientas acordes a los requerimientos
\item PROGRAMAR rutinas
\end{itemize}
Adicionalmente:
\begin{itemize}
\item Se establece un sistema para control de cambios 
\item y se genera documentaci\xc3\xb3n
\end{itemize}
